import React from 'react';

const Rule = ({ index, text, passed }) => {
    return (
        <div style={{ color: passed ? 'green' : 'red' }}>
            {passed ? `✓ Rule ${index}` : `✗ Rule ${index}`} {text}
        </div>
    );
};

export default Rule;
